import React, { useRef } from 'react';
import { useEffect, useState } from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
} from 'chart.js';
import './App.css';
import { BarGraph } from './component/Bar';

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip
);

interface graphInterface {
  id: number,
  velocity: number
}

function App() {

  const c: graphInterface = {
    id: 5,
    velocity: 4
  }
  const result = fetch('http://127.0.0.1:8000/velocity/users').then(resp => resp.json())
  const [data, setData] = useState(result)
  const [x, setX] = useState<number[]>([1, 1])
  const [y, setY] = useState<number[]>([1, 2])

  useEffect(() => {
    const results = fetch('http://127.0.0.1:8000/velocity/users').then(resp => resp.json()).then(json => setData(json))
    // console.log(data)
  })

  useEffect(() => {
    // const results = fetch('http://127.0.0.1:8000/velocity/users').then(resp => resp.json()).then(json => setData(json))
    setX(data.map(d => d.id));
    setY(data.map(d => d.velocity))
  }, [data])


  return (
    <div className="App">
      <div>
        <BarGraph
          x={x}
          y={y} />
      </div>

    </div>
  );
}

export default App;
